import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { MainWrapper, MainContentOption, MainContentWrapper } from "../../components/contentWrapper/ContentWrapper"

import { GenresList } from '../../page/Genres/GenresList.jsx';
const HomeContentBox = () => {
  const dispatch = useDispatch()
  // const [genresbtn, setgenresbtn] = useState(true)
  const [trending, setTending] = useState();

  useEffect(() => {
    let url = "https://nl1.api.radio-browser.info./json/stations/search?hidebroken=true&limit=15&order=clickcount&language=english&reverse=true&tag=pop&tagExact=false"
    fetch(url).then(async (e) => {
      let data = await e.json()
      setTending(data)
      console.log(data)
    })
  }, [])

  let trendingTrigger = detail => (...ev) => {
    //todo error check 
    dispatch(updateCurrentPlaying(
      {
        coverPic: detail.favicon,
        trackName: detail.name,
        currentplayingUrl: detail.url_resolved,
        uuid: detail.stationuuid,
      }
    ));
  }


  return (
    <MainWrapper>
      <MainContentWrapper style={{
        height: '300px', overflowY: 'auto'
      }}>
        {/* {genresbtn ? "Select Radio Genres- " : <GenresList />} */}
        {/* <div onClick={() => setgenresbtn(false)} style={{ textTransform: "capitalize", color: "black" }} >click here </div> */}

        Trending
        {

        }
      </MainContentWrapper>
    </MainWrapper>
  )
}

export default HomeContentBox
